include 'undress.php';

function automask($uid, $base64, $chat_id, $paid){
    
  //  $url = "https://api.telegram.org/bot7905195248:AAFB97i8Cuq8qIRhnQKkmUCYwZ4e4Gq2mHI/sendMessage?chat_id=$chat_id&text=Prosess Automask";

// Send the message via GET request
  //  file_get_contents($url);
    
    $uuid = strtoupper(bin2hex(openssl_random_pseudo_bytes(16)));

   // $base64 = "data:image/jpeg;base64,";
// The API endpoint
$url = 'https://mkv2.undressai.tools/mask';

// Data to send in the POST request (body)
$data = array(
    "continent" => "AS",
    "task_id" => $uuid,
    "image_base64" => $base64,
    "user_id" => $uid,
    "operation" => "undress",
    "country" => "UZ"
);

// Convert the data to JSON format
$json_data = json_encode($data);

// Initialize cURL session
$ch = curl_init($url);

// Set the necessary cURL options
curl_setopt($ch, CURLOPT_URL, $url);
curl_setopt($ch, CURLOPT_RETURNTRANSFER, true);
curl_setopt($ch, CURLOPT_POST, true);
curl_setopt($ch, CURLOPT_POSTFIELDS, $json_data);
curl_setopt($ch, CURLOPT_HTTPHEADER, array(
    'Accept: application/json, text/plain, */*',
    'Accept-Language: ru-RU,ru;q=0.9,en-GB;q=0.8,en;q=0.7,en-US;q=0.6',
    'Authorization: Basic cG9ybmdlbjpwb3JuZ2Vu',
    'Cache-Control: no-cache',
    'Content-Type: application/json',
    'Pragma: no-cache',
    'Priority: u=1, i',
    'Sec-Fetch-Dest: empty',
    'Sec-Fetch-Mode: cors',
    'Sec-Fetch-Site: cross-site',
    'Referer: https://undresser.ai/',
    'Referrer-Policy: strict-origin-when-cross-origin'
));

// Set additional cURL options to mimic the JavaScript fetch options
curl_setopt($ch, CURLOPT_FOLLOWLOCATION, true);

// Execute the cURL request and get the response
$response = curl_exec($ch);

$data_josn = json_decode(''.$response.'', true);





// Check for any cURL errors
if (curl_errno($ch)) {
    echo 'Curl error: ' . curl_error($ch);
} else {
    // Output the response from the API
    if($data_josn['mask_base64'] == ''){
       $url3 = "https://api.telegram.org/bot7870843778:AAEFyyAPrvKB-B1YYrkZ8BdeuGKugKh3p8U/sendMessage?chat_id=$chat_id&text=Ошибка фото. Попробуйте другое фото. Отправьте фото в хорошем качестве с другого ракурса.Photo error. Try another photo. Send a photo in good quality from another angle";

// Send the message via GET request
        file_get_contents($url3);

   }else{
       $url2 = "https://api.telegram.org/bot7870843778:AAEFyyAPrvKB-B1YYrkZ8BdeuGKugKh3p8U/sendMessage?chat_id=$chat_id&text=Prosess...";

// Send the message via GET request
        file_get_contents($url2);
   }

    
    
  undress($uuid, $uid, 'data:image/png;base64,'.$data_josn['mask_base64'], $chat_id, $paid);
    
   // echo $response;
}

